import React from 'react';
import logo from './logo.svg';
import './App.css';
import { isTemplateElement } from '@babel/types';

function App() {
  const todoList = [
    "react practice",
    "game time"
  ]
  return (
    <div className="App">
    <h2>Todo List</h2>
    {
      todoList.map(item => <p>{item}</p>)
    }      
    </div>
  );
}

export default App;
